import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { NavDropdown } from "react-bootstrap";

function NavBar() {
  return (
    <>
      <Navbar fixed="top" bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="./homepage">MyEvent.ro</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <NavDropdown title="Concerte" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Pop</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Rock</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">
                Blues, Country, Folk
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Jazz</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">
                Reggae, Soul, Hip Hop
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">
                Muzica Clasica
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">
                Muzica Populara
              </NavDropdown.Item>
            </NavDropdown>

            <NavDropdown title="Evenimente Culturale" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Teatru</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Opera, Opereta
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">
                Balet, Dans, Cabaret
              </NavDropdown.Item>
            </NavDropdown>

            <NavDropdown title="Alte Evenimente" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">
                Spectacole pentru Copii
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Stand up Comedy
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">
                Expozitii, Vernisaje
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">
                Evenimente Sportive
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Container>
      </Navbar>
    </>
  );
}
export default NavBar;

